################################ Window

class window():
    def __init__(self, app):

        label = CTkLabel(app, text="", image= image).place(relx=0.28,rely=0.27, anchor = "center")

        hour_label = CTkLabel(app, text = "Hour", font=(myfont,21), height = 10, width = 10).place(relx=0.64,rely=0.09, anchor = "center")
        min_label = CTkLabel(app, text = "Min", font=(myfont,21), height = 10, width = 10).place(relx=0.78,rely=0.09, anchor = "center")
        sec_label = CTkLabel(app, text = "Sec", font=(myfont,21), height = 10, width = 10).place(relx=0.92,rely=0.09, anchor = "center")

        spinbox_hour.place(relx=0.64,rely=0.34, anchor = "center")
        spinbox_minute.place(relx=0.78,rely=0.34, anchor = "center")
        spinbox_second.place(relx=0.92,rely=0.34, anchor = "center")

        start_button = CTkButton(app, text = "Start", font = (myfont, 27), width = 388, height = 40, fg_color=color_button,
                                    command = lambda: Thread(target = start_timer()))
        start_button.place(relx = 0.5, rely=0.62, anchor = "center")

        text_out.place(relx=0.5,rely=0.838, anchor = "center")


class start_timer():
    def __init__(self):

        seconds = int(spinbox_second.get())
        minutes = int(spinbox_minute.get())
        hours = int(spinbox_hour.get())

        result = (hours * 3600) + (minutes * 60) + seconds

        if result > 0:

            set_keepawake(keep_screen_awake=True)

            while result:
                root.protocol("WM_DELETE_WINDOW", lambda: Thread(target = self.on_closing()))

                mins, secs = divmod(result, 60)
                hours, mins = divmod(mins, 60)

                timer = '{:02d}:{:02d}:{:02d}'.format(hours, mins, secs)

                text_out.configure(text = timer)
                root.update()

                sleep(1)

                result -= 1

            call(["shutdown", "-s", "-t", "10"])

    def on_closing(self):
        self.quit = CTkToplevel()
        self.quit.geometry("200x130+850+450")
        self.quit.title("Quit?")
        self.quit.minsize(200,130)
        self.quit.maxsize(200,130)

        quit_label = CTkLabel(self.quit, text = "Do you want to quit?\nYou'll cancel the timer.", font = (myfont, 20)).place(relx=0.5,rely=0.3, anchor= "center")
        okay_button = CTkButton(self.quit, text = "Okay", font = (myfont, 18), width= 75, height= 35, fg_color=color_button,
                                    command=lambda: Thread(target=self.root_closing()).start()).place(relx=0.28,rely=0.8, anchor = "center")
        cancel_button = CTkButton(self.quit, text = "Cancel", font = (myfont, 18), width= 75, height= 35,fg_color=color_button,
                                    command=lambda: Thread(target=self.quit_closing()).start()).place(relx=0.72,rely=0.8, anchor = "center")

    def root_closing(self):
        root.destroy()

    def quit_closing(self):
        self.quit.destroy()    

